import React, { Component } from 'react';
import './Artwork.css';
import obruc from  '../assets/gridArt/obruc.jpg';
import dubrovnik from '../assets/gridArt/dubrovnik.jpg';
import sardina from '../assets/gridArt/sardina.jpg';

const GridImage = (prop) => {
  return(
    <div class="col-3 grid-image text-center">
      <img src={prop.src} alt={prop.name} height="100px" width="160px" />
      <p className="image-title">{prop.name}</p>
    </div>
  );
}

const GridRow = (prop) => {
  return(
    <div class="row">
      <div class="col-2">&nbsp;</div>
      <div class="col-8 row">{prop.children}</div>
      <div class="col-2">&nbsp;</div>
    </div>    
  )
}

class Artwork extends Component {
  render() {
    return(
      <div className="artwork">
        <GridRow>
          <GridImage src={obruc} name="P.d. Obruč" />
          <GridImage src={dubrovnik} name="Roofs of Dubrovnik" />
          <GridImage src={sardina} name="Fishy Friday" />
          <GridImage src={obruc} name="P.d. Obruč" />
        </GridRow>
      </div>
    );
  }
}

export default Artwork;
